import styled from "styled-components";
import KayakLogo from "../img/Logo.svg";

const HeaderContainer = styled.div`
    width: 100%;
    height: 60px;
`;
const Logo = styled.div`
    margin: 19px 16px;
`;

const Header = () => {
    return (
        <HeaderContainer>
            <Logo>
                <img src={KayakLogo} alt="Kayak Logo" />
            </Logo>
        </HeaderContainer>
    );
};

export default Header;
